\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"0f596e34-9c52-4f6a-8e17-3ec1a15fb229\"},\"disableImageZooming\":false},\"text\":\"<p>Rellena los huecos con la palabra adecuada.</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":49,\"feedback\":\"1\"},{\"from\":50,\"to\":62,\"feedback\":\"2\"},{\"from\":63,\"to\":75,\"feedback\":\"3\"},{\"from\":76,\"to\":87,\"feedback\":\"4\"},{\"from\":88,\"to\":100,\"feedback\":\"5\"}],\"showSolutions\":\"Mostrar solución\",\"tryAgain\":\"Intentar de nuevo\",\"checkAnswer\":\"Comprobar\",\"submitAnswer\":\"Enviar\",\"notFilledOut\":\"Por favor, completa todos los huecos para poder ver la solución\",\"answerIsCorrect\":\"&#039;:ans&#039; es correcta\",\"answerIsWrong\":\"&#039;:ans&#039; es incorrecta\",\"answeredCorrectly\":\"Contestado correctamente\",\"answeredIncorrectly\":\"Contestado incorrectamente\",\"solutionLabel\":\"Respuesta correcta:\",\"inputLabel\":\"Hueco @num de @total\",\"inputHasTipLabel\":\"Pista disponible\",\"tipLabel\":\"Pista\",\"behaviour\":{\"enableRetry\":false,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"autoCheck\":false,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":true,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":true},\"scoreBarLabel\":\"Has conseguido :num de un total de :total puntos\",\"a11yCheck\":\"Comprobar las respuestas. Las respuestas serán marcadas como correcta, incorrectas o sin contestar.\",\"a11yShowSolution\":\"Mostrar la solución. La tarea se marcará con su solución correcta.\",\"a11yRetry\":\"Vuelve a intentar la tarea. Borra todas tus respuestas y empieza de nuevo.\",\"a11yCheckingModeHeader\":\"Modo de Comprobación\",\"confirmCheck\":{\"header\":\"¿ Terminar ?\",\"body\":\"¿Está seguro que desea terminar ?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Terminar\"},\"confirmRetry\":{\"header\":\"¿Intentar de nuevo?\",\"body\":\"¿Seguro que quieres volver a intentarlo?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Confirmar\"},\"questions\":[\"<p>En *Valencia*, durante las Fallas, se queman grandes *figuras* satíricas de políticos, toreros, etc., hechas de *papel*. También se puede ir a la playa y comer *paella*, un plato típico de esa zona.</p>\\n\\n<p>En *Cádiz* se celebra el Carnaval con una *fiesta* muy especial porque hay chirigotas, que son grupos de gente que va *disfrazada* y canta canciones humorísticas.</p>\\n\\n<p>En la Feria de Abril, se bailan *sevillanas* y la gente se viste con un traje *típico*.</p>\\n\\n<p>Jóvenes de todo el *mundo* van a Buñol para *participar* en la Tomatina, una batalla en la que se lanzan toneladas de *tomates*.</p>\\n\"]}","library":"H5P.Blanks 1.14","contentUrl":".","metadata":{"license":"CC BY-NC","title":"Fiestas","defaultLanguage":"en","authors":[{"name":"Bettina Karácsonyi","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.Question-1.5/scripts/question.js?version=1.5.13","/h5p/libraries/H5P.Question-1.5/scripts/explainer.js?version=1.5.13","/h5p
